import React, { useState } from "react";

const PersonalPage = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");

  return (
    <div>
      <h2>Trang Cá Nhân của Người Dùng</h2>
      <p>Tên: {name}</p>
      <p>Địa chỉ email: {email}</p>
    </div>
  );
};

export default PersonalPage;
